import { Food } from "../models/Food";

export const FoodData: Food[] = [
  { id: 0, name: "name0", price: 0, ingredients: "skład0" },
  { id: 1, name: "name1", price: 10, ingredients: "skład1" },
  { id: 2, name: "name2", price: 20, ingredients: "skład2" },
];
